import React,{Component} from "react"
import Header from "../../component/Header/Header"

class Film extends Component{
    constructor(props){
        super(props);
        this.state={
            title:"电影页"
        }
    }
    render(){
        return(
            <div>
                <Header titlt={this.state.title}/>
                {this.state.title}
            </div>
        )
    }
}
export default Film
